import React from "react";


function Login() {
    return (

        <form className="login">
            <h1 className="login__title">Вход</h1>
            <input className="login-input__email" placeholder="Email"></input>
            <input className="login-input__password" placeholder="Пароль"></input>
            <button className="login__button">Войти</button>
        </form>

    );
}

export default Login;
